content.css:
html,
body {
  position: absolute;
  padding: 0;
  margin: 0;
  width: 100%;
  height: 100%;
  overflow: hidden;
}
.infonice-message-box {
  position: absolute;
  /* Stay in place */
  z-index: 20000;
  /* Sit on top */
  left: 0;
  top: 0;
  width: 100%;
  /* Full width */
  height: 100%;
  /* Full height */
  overflow: auto;
  /* Enable scroll if needed */
  background-color: #000000;
  /* Fallback color */
  background-color: rgba(0, 0, 0, 0.4);
  /* Black w/ opacity */
  display: flex;
  align-items: center;
}
.infonice-message-box-body {
  position: relative;
  background-color: #e0e0e0;
  margin: auto;
  /* 15% from the top and centered */
